import axios from "axios";
import React, { useEffect, useState } from "react";

const ProvidersMovies = ({ id }) => {
  const [data, setData] = useState([]);
  const array = [];

  useEffect(() => {
    axios
      .get(
        `https://api.themoviedb.org/3/movie${id}/watch/providers?api_key=864b6602f4018630491e67fa714381e6`
      )
      .then((res) =>
        setData(
          res.data.results.FR ? array.push(res.data.results.FR) : "il  y a pas "
        )
      );
  }, [id, data]);

  return <div>{data}</div>;
};

export default ProvidersMovies;
